import React from 'react'

const MapMarker = ({text, handleClick, isMain}) => {
    style = {
                  color: 'white',
                  background: 'grey',
                  padding: '5px 3px',
                  display: 'inline-flex',
                  textAlign: 'center',
                  alignItems: 'center',
                  justifyContent: 'center',
                  borderRadius: '10%'
    }
    return (
      <div style={this.style}
            onClick={handleClick}>
      {isMain ? text : ''}
      </div>
    )
}

export default MapMarker
